class Solution:
    def deleteString(self, s: str) -> int:
        n = len(s)
        if len(set(s)) == 1:
            return n

        # s[i:] & s[j:] 最长公共前缀的长度
        longest_common_prefix = [[0] * (n + 1) for _ in range(n + 1)]
        # O(n^2)
        for i in range(n - 1, -1, -1):
            for j in range(n - 1, i, -1):
                if s[i] == s[j]:
                    longest_common_prefix[i][j] = longest_common_prefix[i + 1][j + 1] + 1

        dp = [0] * n
        for i in range(n - 1, -1, -1):
            for j in range(1, (n - i) // 2 + 1):
                # equals s[i:i+j] == s[i+j:i+2*j]
                if longest_common_prefix[i][i + j] >= j:
                    dp[i] = max(dp[i + j], dp[i])
            dp[i] += 1

        return dp[0]

# s = "abcabcdabc"
# s = "aaabaab"
# s = "aaaaa"
# s = "gy"
s = ""
print(Solution().deleteString(s))
